import React from 'react'
import { Link } from 'react-router-dom';
const Navigation = () => {
  return (
    <>
        <nav>
            <Link id="home-link" className="nav-item" to="/" exact>Home</Link>
            <Link id="page-one" className="nav-item" to="/page-one">Page 1</Link>
            <Link id="page-two" className="nav-item" to="page-two">Page 2</Link>
        </nav>
    </>
  )
}

export default Navigation
